import React, { useState } from 'react' 
import { useHistory } from "react-router-dom";
import sd from "../assets/img/ZooLogos/SanDiego.png";
import bronx from "../assets/img/ZooLogos/bronx.png";

function Navigation() {
    let history = useHistory();

    function handleClick(source) {
        history.push("/AcctPage", {imgSrc: source})
        console.log(source)
    }
    //const debug = () => console.log(history.location());

    return (
     <div>
        <button src="sd" onClick={() => handleClick(sd)} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
        <button src="bronx" onClick={() => handleClick(bronx)} type="button">
            <img 
                src={bronx} 
                id="icon"
                alt="BronxZooLogo" 
                title="BronxZoo"> 
            </img>
        </button>
     </div>
    );
  }
  export default Navigation;
